tables.table_schema:
CREATE TABLE Urban_Planning_Demographics (
    City VARCHAR(50),
    Population INT,
    Median_Age FLOAT,
    Median_Income INT
);

CREATE TABLE education_level (
    id UUID PRIMARY KEY,
    city VARCHAR,
    education_level VARCHAR,
    educational_attainment FLOAT
);

CREATE TABLE City (
    CityID INT PRIMARY KEY,
    CityName VARCHAR(255),
    Population INT,
    Area FLOAT
);

CREATE TABLE Neighborhood (
    NeighborhoodID INT PRIMARY KEY,
    NeighborhoodName VARCHAR(255),
    CityID INT,
    PopulationDensity FLOAT
);

CREATE TABLE Ethnicity (
    EthnicityID INT PRIMARY KEY,
    CensusID INT,
    EthnicityCategory VARCHAR(255),
    Percentage FLOAT
);

CREATE TABLE IncomeData (
    IncomeDataID INT PRIMARY KEY,
    CensusID INT,
    HouseholdIncome FLOAT,
    PovertyRate FLOAT
);
